import React from 'react';
import  ReactDOM  from 'react-dom/client';
const root = ReactDOM.createRoot(document.getElementById('root'))
let data = [
  {id:1,title:"我是第一个标题"},
  {id:2,title:"我是第二个标题"},
  {id:3,title:"我是第三个标题"}
]
/*数据循环 */
root.render(
  <>
 <h2>新闻列表</h2>
 <ul className='news-list'>
   {data.map((item,index)=>{
    return   <li key={item.id}>
    <span>{item.title}</span>
   </li>
    
   })}
  
 </ul>
   
  </>
)
